    {ntt"total": 2,ntt"recent": 0nt},nt"groups": [],nt"relationships_as_subject":
    [],nt"revision_timestamp": "2015-05-07T01:17:38.976901",nt"name": "electrophoretic-focusing-an-alternative-to-capillary-electrophoresis-project",nt"isopen":
    true,nt"url": null,nt"notes": "Electrophoretic focusing is a new separation
    method intended to achievenhigh resolution within very short sample residence times
    because onenfraction is separated at a time instead of all fractions at once, ancharacteristic
    of capillary and other zonal separation systems.  Samplenis inserted within a continuous
    buffer flow steam as a thin lamina andnis collected in a single port at the exit
    end of the chamber. Applyingnan electric field transverse to the incoming sample
    and opposing thisnfield with a carefully configured buffer flow a sample constituent
    cannbe selected and focused into the collection port for subsequentnanalysis. Monotonically
    changing either electric field or bufferncross-flow will yield a scan of the entire
    sample population.  Stoppingnthe scan increases the collection time for minor constituents.nExtraneous
    sample is deflected out of the separation chamber throughnporous walls while the
    selected sample is focused in the center-plane ofnthe separation chamber and collected
    without contact or interaction withnthe walls.  Adverse effects of electroosmosis
    and other spurious flowsnare minimal.  The design limits Joule heating and electrohydrodynamicsnduring
    the electrophoresis process and thus should achieve a highnresolution of separation
    in an analytical or preparative mode.",nt"license_title": "U.S. Government
